import React from 'react';

const currentWeather = (props) => {
  console.log(props)
  return(
  <div>
      <p>Температура на улице{Math.floor(props.data.temp)}</p>
      <p>Текущая облачность {props.data.clouds} %</p>
      
  </div>
  )
}

export default currentWeather;
